import React, { useState } from 'react';
import { Link, useHistory } from 'react-router-dom';

function LoginPage() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const history = useHistory();

  const login = () => {
    // Your login logic here
    const isValid = true; // Set your condition for validity

    if (isValid) {
      // Navigate to "/about" if the condition is satisfied
      history.push('/about');
    }
  };

  return (
    <div className='login'>
      <link href='https://unpkg.com/boxicons@2.1.4/css/boxicons.min.css' rel='stylesheet'></link>
      <section>
        <form>
          <h1>Login</h1>
          <div className="input-box">
            <input type="text" placeholder='Email' value={email} onChange={(e) => setEmail(e.target.value)} required />&nbsp;
            <i className='bx bxs-envelope'></i>
          </div>
          <div className="input-box">
            <input type="password" placeholder='Password' value={password} onChange={(e) => setPassword(e.target.value)} required />&nbsp;
            <i className='bx bxs-lock-alt'></i>
          </div>
          {/*           
          <div className="ForgotPass">
            <Link itemProp="url" to="/signup">Forgot Password?</Link>
          </div> */}
          <button id="login" type="button" className="btn" onClick={login}>
            Login
          </button>
          <div className="createacc">
            Don't have an account?&nbsp;
            <Link itemProp="url" to="/signup">Register Here</Link>
          </div>
        </form>
      </section>
    </div>
  );
}

export default LoginPage;
